import React from 'react';
import Slider from 'react-slick';
import pinImage from './images/pin.JPEG';
import caveringImage from './images/cavering.JPEG';
import butterflyringImage from './images/butterflyring.JPEG';
import necklesImage from './images/neckles.JPEG';
import bangleImage from './images/bangle.JPEG';

const Home = () => {
  const settings = {
    dots: false,
    infinite: true,
    speed: 1000,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 5000,
    centerMode: true,
    centerPadding: '0px',
  };

  return (
    <div className="home-container">
      <h1><b><i>Home</i></b></h1>
      <Slider {...settings}>
        <div className="carousel-item">
          <img className="d-block w-100" src={pinImage} alt="Pin Slide" />
        </div>
        <div className="carousel-item">
          <img className="d-block w-100" src={caveringImage} alt="Cavering Slide" />
        </div>
        <div className="carousel-item">
          <img className="d-block w-100" src={butterflyringImage} alt="Butterfly Ring Slide" />
        </div>
        <div className="carousel-item">
          <img className="d-block w-100" src={necklesImage} alt="Neckles Slide" />
        </div>
        <div className="carousel-item">
          <img className="d-block w-100" src={bangleImage} alt="Bangle Slide" />
        </div>
      </Slider>
    </div>
  );
};

export default Home;
